const profileJquery= ()=>{
var $;
$ = require('jquery');
$(function(){
  console.log('Profile-Jquery');
  $('#profile-image-id').hover(function(){
    $(this).css("background-color", "yellow");
    $('.profile-info').toggleClass('active')
  
  })
  
  
  })
}
export default profileJquery;
